import React from 'react';
import Aux from '../../hoc/Aux';

const layout = (props) => {
    return(
        <Aux>
        <div> Tool Bar, Side Draw, Backdrop</div>
        <main>
            {props.children}
        </main>
        </Aux>
    )
}

export default layout;
